import React, { Component } from 'react';

class LoginPage extends Component {
  render() {
    return  (
      <div className="bg-img">
          <header className="App-header">
          <img src='./logo.png' className="App-logo" alt="logo" />
          <c className='font-style'>ระบบการจัดการสมาชิก บุคลากรและหุ้นสำหรับสหกรณ์โคเนื้อ</c>
          <c  className='font-style'>MEMBER OFFICER AND SHARE MANAGEMENT SYSTEM OF THE  BEEF COOPERATIVE</c>
          </header>
      </div>
  )
  }
}

export default LoginPage;
